import React, { Component } from "react";
import { getMovies } from "../services/fakeMovieService";

export default class Movies extends Component {
  state = {
    movies: getMovies(),
  };

  render() {
    return (
      <div>
        {this.state.movies.map((movie) => {
          return (
            <table>
              <tr>
                  <th>Title</th>
                  <th>Genre</th>
                  <th>Stock</th>
                  <th>Rate</th>
                  <th>Title</th>
              </tr>
            </table>
          );
        })}
      </div>
    );
  }
}
